async function getDataAsync(){var n=await fetch("api/users/registeredusers");return await n.json()}function addData(n,t,i){n.data.labels.push(t);n.data.datasets.forEach(n=>{n.data.push(i)});n.update()}function removeData(n){n.data.labels.pop();n.data.datasets.forEach(n=>{n.data.pop()});n.update()}Chart.defaults.global.defaultFontFamily="Nunito";Chart.defaults.global.defaultFontColor="#858796";var ctx=document.getElementById("registeredUsersChart"),registeredUsersChart=new Chart(ctx,{type:"line",data:{labels:[],datasets:[{label:"Users",lineTension:.3,backgroundColor:"rgba(78, 115, 223, 0.05)",borderColor:"rgba(78, 115, 223, 1)",pointRadius:3,pointBackgroundColor:"rgba(78, 115, 223, 1)",pointBorderColor:"rgba(78, 115, 223, 1)",pointHoverRadius:3,pointHoverBackgroundColor:"rgba(78, 115, 223, 1)",pointHoverBorderColor:"rgba(78, 115, 223, 1)",pointHitRadius:10,pointBorderWidth:2,data:[]}]},options:{maintainAspectRatio:!1,layout:{padding:{left:10,right:25,top:25,bottom:0}},scales:{xAxes:[{time:{unit:"date"},gridLines:{display:!1,drawBorder:!1},ticks:{maxTicksLimit:7}}],yAxes:[{ticks:{maxTicksLimit:5,padding:10,callback:function(n){return n}},gridLines:{color:"rgb(234, 236, 244)",zeroLineColor:"rgb(234, 236, 244)",drawBorder:!1,borderDash:[2],zeroLineBorderDash:[2]}}]},legend:{display:!1},tooltips:{backgroundColor:"rgb(255,255,255)",bodyFontColor:"#858796",titleMarginBottom:10,titleFontColor:"#6e707e",titleFontSize:14,borderColor:"#dddfeb",borderWidth:1,xPadding:15,yPadding:15,displayColors:!1,intersect:!1,mode:"index",caretPadding:10,callbacks:{label:function(n,t){var i=t.datasets[n.datasetIndex].label||"";return i+": "+n.yLabel}}}}});(()=>{removeData(registeredUsersChart);var n=await getDataAsync();n.forEach(n=>addData(registeredUsersChart,n.registrationDate,n.usersCount))})();